import axios from 'axios'


export const register = newUser => {
    return axios
        .post('/signup',{
            username: newUser.username,
            masterkey: newUser.masterkey
        })
        .then(res => {

            return res.data
        })
        .catch(err =>{
            console.log(err)
        })

}

export const login = user => {
    return axios

        .post('/login', {
            username: user.username,
            masterkey: user.masterkey
            })
        .then(res => {
            localStorage.setItem('token', res.data.token)
            localStorage.setItem('id', res.data.id)

            return res.data
        })
        .catch (err => {
            console.log(err)
        })
}

export const credentials = newProgram => {
    return axios

        .post('/add-program', {
            program: newProgram.program,
            username: newProgram.username,
            password: newProgram.password,
            id: newProgram.id
            })
        .then(res => {

            return res.data
        })
        .catch (err => {
            console.log(err)
        })
}

export const programs = listPrograms => {
    const token = localStorage.getItem('tok')

    if(!token){
        history.push('/')
    }
    return axios

        .get('/programs?token=' + token, {
            program: programs.program,
            username: programs.username,
            password: programs.password,
            })
        .then(res => {
            console.log(res.data)
            return res.data
        })
        .catch (err => {

            console.log(err)
        })
}
export const remove = programName => {
    return axios

        .post('/remove-program', {
            program: programName,
            })
        .then(res => {
            if(res.data.error) {
                this.props.history.push('/')

            } else{

                return res.data
            }
        })
        .catch (err => {
            console.log(err)
        })
}
